import './App.css';
import { useState } from 'react';


function App() {
  const [counter, setCounter] = useState(0);
  return (
    <div> 
      <h1>Hello, World!</h1>
      <button onClick={() => {
           setCounter(counter + 1)
      }}>Increment</button>
      </div>
  );
}

export default App;
